import { Layout } from 'antd';
import React, { Component } from 'react';
const { Footer } = Layout;

export default class FootLayout extends Component {
    render() {
        return (
            <Footer style={{ background: '#fff', padding: 0, display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
                123
            </Footer>
        );
    }
}
